import React from "react";
import Header from "../../.././shared/Components/Header/Header";
import Footer from "../../.././shared/Components/Footer/Footer";

const Home = () =>{

    return (
        <div>
            <Header/>
            <div className="homeContent">
                <div className = "description">
                    <p>Welcome to your, <span style = {{color:"#32CD32"}}>Stocks</span>and 
                        <span style = {{color:"#DC143C"}}>Crypto</span> Market Community</p>
                </div>
                <div className>
                    <img style = {{background:"crimson"}}></img>
                </div>
            </div>
            <Footer/>
        </div>
    );
}

export default Home;
